import { Container, Row, Col } from "react-bootstrap";
import { Link, NavLink } from "react-router-dom";
import Navbar from "../../Navbar/Navbar";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Grid from "@mui/material/Grid";
import Button from "@mui/material/Button";

import "./Home.css";

import headerImg from "../../../img/header-img.png";
import headerLogo from "../../../img/header-logo.png";

export default function Home() {
  return (
    <>
      {/* <Navbar /> */}
      <Grid container spacing={2} sx={{ marginTop: "100px" }}>
        {/* <div className="header"> */}
        <Grid xs={6}>
          <img src={headerLogo} alt="" className="header-logo"></img>
          <h3 className="header-h3">
            Quickly and Easily Discover Developers Like You, Connect With Your
            Ideal Teammates and Coding Better Together.
          </h3>
          <Button
            type="submit"
            variant="contained"
            underline="none"
            sx={{
              ":hover": {
                bgcolor: "#e4a300",
              },
              mt: 3,
              mb: 2,
              backgroundColor: "#FFB703",
              marginLeft: "200px",
            }}
          >
            <Link
              to="/signup"
              style={{ color: "white", textDecoration: "none" }}
            >
              Sign up
            </Link>
          </Button>
          <Button
            type="submit"
            variant="contained"
            sx={{
              mt: 3,
              mb: 2,
              marginLeft: "15px",
              backgroundColor: "#00468B",
              ":hover": {
                bgcolor: "#00366b",
              },
            }}
            onClick={() => {}}
          >
            What is Devteams
          </Button>
          <p className="header-p">
            Already a member?
            <Link to="/signin" className="header-link">
              Log in here
            </Link>
          </p>
        </Grid>

        <Grid xs={6}>
          <img src={headerImg} alt="" className="header-img"></img>
        </Grid>
      </Grid>

      <React.Fragment>
        <CssBaseline />
        <AppBar>
          <Toolbar>
            <Typography variant="h6" component="div">
              Scroll to see button
            </Typography>
          </Toolbar>
        </AppBar>
        <Toolbar id="back-to-top-anchor" />
        <Container>
          <Box sx={{ my: 2 }}>
            {[...new Array(12)]
              .map(
                () => `Cras mattis consectetur purus sit amet fermentum.
Cras justo odio, dapibus ac facilisis in, egestas eget quam.
Morbi leo risus, porta ac consectetur ac, vestibulum at eros.
Praesent commodo cursus magna, vel scelerisque nisl consectetur et.`
              )
              .join("\n")}
          </Box>
        </Container>
        <ScrollTop {...props}>
          <Fab color="secondary" size="small" aria-label="scroll back to top">
            <KeyboardArrowUpIcon />
          </Fab>
        </ScrollTop>
      </React.Fragment>
    </>
  );
}
